import React from "react";
import { Col, Row } from "reactstrap";

class Savecards extends React.Component{
    handleedit=(ind)=>{
        
    }
    handleshare=(ind)=>{
        console.log("share");
    }
    handledelete=(ind)=>{
        console.log("delete");
    }
    render(){
        return(
            <Col lg="4" md="6" sm="9" xs="10">
                <div className="card-wrap">
                    <div className="cover">
                        <ul>
                            <li onClick={this.handleedit(this.props.ind)}><i className="fas fa-edit"></i></li>
                            <li onClick={this.handleshare(this.props.ind)}><i className="fas fa-share"></i></li>
                            <li onClick={this.handledelete(this.props.ind)}><i className="fas fa-trash"></i></li>
                        </ul>
                    </div>
                    <Row className="inner-layer">
                        <Col lg="3" md="3" sm="3" xs="3" style={{minHeight:"inherit"}}>
                            <div className="fileimage">
                                <i class="fa fa-file" aria-hidden="true"></i>
                            </div>
                        </Col>
                        <Col lg="9" md="9" sm="9" xs="9">
                            <p>{this.props.result[this.props.ind].name}</p>
                            <div className="foot">
                                <span id="status"><i className="fas fa-circle"style={{fontSize:"10px"}}></i> {this.props.result[this.props.ind].mode}</span>
                            </div>
                        </Col>
                    </Row>

                </div>
            </Col>

        );

    }

}
export default Savecards;
